import React, { useState } from 'react';
import ProgressIndicator from './ProgressIndicator';
import DietaryPreferences from '../pages/DietaryPreferences';
import FoodChoices from '../pages/FoodChoices';
import MealFrequency from '../pages/MealFrequency';

function PersonalizeExperience() {
  const [completedSteps, setCompletedSteps] = useState([false, false, false, false]);

  return (
    <div>
      <ProgressIndicator completedSteps={completedSteps} />
      {/* Render your components conditionally based on the current step */}
      <DietaryPreferences setCompletedSteps={setCompletedSteps} />
      <FoodChoices setCompletedSteps={setCompletedSteps} />
      <MealFrequency setCompletedSteps={setCompletedSteps} />
    </div>
  );
}

export default PersonalizeExperience;
